import React from 'react';

function Categories(props) {
  return (
	<div className="col-lg-6 mb-4">
		<div className="card bg-info text-white shadow">
			<div className="card-body">
				<p>{props.categoria}</p>
			</div>
		</div>
	</div>
    );
}

export default Categories;
